import "./css/Main.css"
import Homepage from "./Homepage";
import Highlight from "./Highlight";
import Privacy from "./Privacy";
import Gallery from "./Gallery1";
import Accessibility from "./Accessibility";
import Contact from "./Contact";
import About from "./About";
import Thanks from "./Thanks";
import Melchiott from "./Melchiott";
import Duxford from "./Duxford";


function Main({ page, thanksfunction,onNav }) {
  return (
    <main id="main">
      {(page === "/") && <Homepage />}
      {(page === "/Highlight.html") && <Highlight />}
      {(page === "/Gallery.html") && <Gallery />}

      {(page === "/About.html") && <About onNav={onNav} />}
      {(page === "/Accessibility.html") && <Accessibility />}
      {(page === "/Duxford.html") && <Duxford />}
      {(page === "/Melchiott.html") && <Melchiott />}
      {/* {(page === "/Thanks.html") && <Thanks />} */}

      {(page === "/Privacy.html") && <Privacy />}
      {(page === "/Contact.html") && <Contact thanksfunction={thanksfunction}/>}

    </main>



  );
}

export default Main;
